import Link from 'next/link';
import style from '../static/Style';
import Counter from '../components/Counter';
import Layout from '../components/Layout';
import Test from '..'

export default () => (
  <Layout header ="Next" title ="Top page.">
    <div>
      <Counter/>
      <hr/>
      <Test />
      <Link href="./other">
        <button>
          go to other &gt;&gt;
        </button>
      </Link>
    </div>
  </Layout>
);
